import React from "react"

function Pagination(){
    return(
        <div className="pagination">
            <div className="pagination-wrapper">
                <div className="pag-item-container">1</div>
                <div className="pag-item-container">2</div>
                <div className="pag-item-container">3</div>
            </div>
        </div>
    );
}

export default Pagination
